import React, { Component } from 'react'
import './Nav.css'
import { Link } from 'react-router-dom'
import PropTypes from 'prop-types'
import { connect } from 'react-redux'
import { logoutUser } from '../actions/authActions'

class Nav extends Component {
  onLogoutClick = (e) => {
    e.preventDefault()
    this.props.logoutUser()
  }

  render() {
    return (
      <div>
        <nav className="nav-extended">
          <Link style={{ color: '#fff', textDecoration: 'none' }} to="/menu">
            <h3>Fithabit</h3>
          </Link>
          <Link data-target="mobile-demo" className="sidenav-trigger">
            <i className="material-icons">menu</i>
          </Link>
          <ul id="nav-mobile" className="right hide-on-med-and-down">
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/squat-ranking"
            >
              <li>Ranking</li>
            </Link>
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/my-records"
            >
              <li>Record</li>
            </Link>
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/profile"
            >
              <li>Profile</li>
            </Link>
            <Link
              onClick={this.onLogoutClick}
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
            >
              <li>Logout</li>
            </Link>
          </ul>
        </nav>
        <ul className="sidenav" id="mobile-demo">
          <Link
            style={{
              color: '#fff',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/squat-ranking"
          >
            <li>Ranking</li>
          </Link>
          <Link
            style={{
              color: '#fff',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/my-records"
          >
            <li>Record</li>
          </Link>
          <Link
            style={{
              color: '#fff',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/profile"
          >
            <li>Profile</li>
          </Link>
          <Link
            onClick={this.onLogoutClick}
            style={{
              color: '#fff',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
          >
            <li>Logout</li>
          </Link>
        </ul>
      </div>
    )
  }
}

Nav.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
}

const mapStateToProps = (state) => ({
  auth: state.auth,
})

export default connect(mapStateToProps, { logoutUser })(Nav)
